import React from "react";
import "./Header.css";
const Header = () => {
  return (
    <header className="header">
      <div className="centered">Home</div>
      <div className="centered">Store</div>
      <div className="centered">About</div>
      <div className="cart">
        <button>Cart</button>
      </div>
    </header>
  );
};

export default Header;
